!(function () {
    var e, n;
    window.ChatbotConfig
      ? ((e = window.ChatbotConfig),
        ((n = document.createElement("iframe")).src =
          e.baseUrl + "/signin?token=" + e.token),
        (n.style.width = "100%"),
        (n.style.height = "600px"),
        (n.style.border = "none"),
        document.addEventListener("DOMContentLoaded", function () {
          document.body.appendChild(n);
        }))
      : console.error("ChatbotConfig không được định nghĩa");
  })();